-- ------------------------------ Table structure for pms_refund-- ----------------------------DROP TABLE IF EXISTS `pms_refund`;CREATE TABLE `pms_refund` (  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据库记录产生时间',  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '数据库记录更新时间',  `order_id` varchar(50) NOT NULL COMMENT '后台生成的正式订单流水号，全局唯一',  `refund_no` varchar(50) NOT NULL COMMENT '后台生成的订单退款流水号，全局唯一，一个order_id可能有多个refund_no',  `refund_fee` int(11) NOT NULL COMMENT '一笔订单可能分多次退款，该栏位仅为某一笔退款申请的总金额，单位人民币/分取整',  `refund_status` varchar(20) NOT NULL COMMENT '退款状态',  `refund_err_code` varchar(20) DEFAULT NULL COMMENT '退款错误代码',  `refund_err_desc` varchar(20) DEFAULT NULL COMMENT '退款错误描述',  `sync_time` timestamp NULL DEFAULT NULL COMMENT '上次向三方查询、同步信息的时间',  `is_closed` tinyint(1) NOT NULL DEFAULT '0' COMMENT '该笔退款是否处理完成（结果可能成功或失败）',  `close_time` timestamp NULL DEFAULT NULL COMMENT '退款处理完成时间',  `remark` varchar(200) DEFAULT NULL COMMENT '备注',  PRIMARY KEY (`refund_no`),  UNIQUE KEY `order_id` (`refund_no`),  KEY `order_id_2` (`order_id`),  CONSTRAINT `pms_refund_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `pms_order_pay` (`order_id`)) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='退款状态表';
-- ------------------------------ Records of pms_refund-- ----------------------------
-- ------------------------------ Table structure for pms_refund_detail_wx-- ----------------------------DROP TABLE IF EXISTS `pms_refund_detail_wx`;CREATE TABLE `pms_refund_detail_wx` (  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据库记录产生时间',  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '数据库记录更新时间',  `refund_no` varchar(50) NOT NULL COMMENT '后台生成的订单退款流水号',  `refund_count` int(11) DEFAULT NULL COMMENT '退款笔数',  `refund_id_sn` int(11) DEFAULT NULL COMMENT '微信退款编号，即 _$n 中n值',  `refund_id` varchar(32) DEFAULT NULL COMMENT '微信退款单号',  `refund_status` varchar(16) DEFAULT NULL COMMENT '退款状态',  `refund_success_time` timestamp NULL DEFAULT NULL COMMENT '退款成功时间',  `refund_account` varchar(30) DEFAULT NULL COMMENT '退款资金来源',  `refund_recv_accout` varchar(64) DEFAULT NULL COMMENT '退款入账账户',  `refund_channel` varchar(16) DEFAULT NULL,  `refund_fee` int(11) DEFAULT NULL COMMENT '退款金额',  `refund_fee_type` varchar(8) DEFAULT NULL COMMENT '退款货币种类',  `settlement_total_fee` int(11) DEFAULT NULL COMMENT '应结退款金额',  `cash_refund_fee` int(11) DEFAULT NULL COMMENT '现金退款金额',  `coupon_refund_fee` int(11) DEFAULT NULL COMMENT '代金券退款总金额',  KEY `refund_no` (`refund_no`),  CONSTRAINT `pms_refund_detail_wx_ibfk_1` FOREIGN KEY (`refund_no`) REFERENCES `pms_refund` (`refund_no`)) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信支付退款明细表';
